import React, {useEffect, useState} from 'react'


function Innovation() {

    const [data, setData] = useState([])

    const fetchData = () => {
        fetch("https://raw.githubusercontent.com/Sreekanthm7/jsondata/main/azure-json-data/data.json")
        .then(responce => {
            return responce.json()
        })
        .then(data => {
            console.log(data.ino);
        })
    }

    useEffect(() => {
        fetchData()
    },[])
  return (
    <div>Innovation</div>
  )
}

export default Innovation
